import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './TargetForm.css'; // Include your existing styles for the ToO form

function ToOAndTables() {
    const [data, setData] = useState({});
    const [loading, setLoading] = useState(true);

    // State for ToO form
    const [selectedTarget, setSelectedTarget] = useState('');
    const [ra, setRa] = useState('');
    const [dec, setDec] = useState('');
    const [exposure, setExposure] = useState('');
    const [mode, setMode] = useState('');
    const [targets, setTargets] = useState([]);

    // Fetch data tables
    useEffect(() => {
        axios.get('http://127.0.0.1:5000/api/data')
            .then((response) => {
                setData(response.data);
                setLoading(false);
            })
            .catch((error) => {
                console.error("Error fetching data:", error);
                setLoading(false);
            });
    }, []);

    // Fetch target list for the form
    useEffect(() => {
        // Example endpoint to fetch target list
        axios.get('http://127.0.0.1:5000/api/targets')
            .then((response) => {
                setTargets(response.data);
            })
            .catch((error) => {
                console.error("Error fetching targets:", error);
            });
    }, []);

    // Handle form submission
    const handleSubmit = (e) => {
        e.preventDefault();
        const formData = { selectedTarget, ra, dec, exposure, mode };
        console.log('Form Submitted:', formData);
        // You can send formData to the backend here if needed
    };

    // Handle target change
    const handleTargetChange = (e) => {
        const targetName = e.target.value;
        setSelectedTarget(targetName);

        if (targetName === 'new target') {
            setRa('');
            setDec('');
        } else {
            const target = targets.find(t => t.name === targetName);
            if (target) {
                setRa(target.ra);
                setDec(target.dec);
            }
        }
    };

    if (loading) {
        return <p>Loading...</p>;
    }

    return (
        <div className="container">
            <h2>7DT Target of Opportunity (ToO) Request</h2>
            <form onSubmit={handleSubmit}>
                <div>
                    <label htmlFor="target">Target:</label>
                    <select id="target" value={selectedTarget} onChange={handleTargetChange}>
                        <option value="">--Select a Target--</option>
                        <option value="new target">New Target</option>
                        {targets.map((target, index) => (
                            <option key={index} value={target.name}>
                                {target.name}
                            </option>
                        ))}
                    </select>
                </div>

                <div>
                    <label htmlFor="ra">RA:</label>
                    <input
                        id="ra"
                        type="text"
                        value={ra}
                        onChange={(e) => setRa(e.target.value)}
                        disabled={selectedTarget !== 'new target'}
                        className={selectedTarget !== 'new target' ? 'disabled' : ''}
                    />
                </div>

                <div>
                    <label htmlFor="dec">DEC:</label>
                    <input
                        id="dec"
                        type="text"
                        value={dec}
                        onChange={(e) => setDec(e.target.value)}
                        disabled={selectedTarget !== 'new target'}
                        className={selectedTarget !== 'new target' ? 'disabled' : ''}
                    />
                </div>

                <div>
                    <label htmlFor="exposure">Exposure:</label>
                    <input
                        id="exposure"
                        type="text"
                        value={exposure}
                        onChange={(e) => setExposure(e.target.value)}
                    />
                    <span> seconds</span>
                </div>

                <div>
                    <label htmlFor="mode">Mode:</label>
                    <select
                        id="mode"
                        value={mode}
                        onChange={(e) => setMode(e.target.value)}
                    >
                        <option value="">--Select a Mode--</option>
                        <option value="Mode A">Mode A</option>
                        <option value="Mode B">Mode B</option>
                        <option value="Mode C">Mode C</option>
                    </select>
                </div>

                <button type="submit">Submit</button>
            </form>

            <h2>Data Tables</h2>
            {Object.keys(data).map((key) => (
                <div key={key} style={{ marginBottom: '20px' }}>
                    <h3>{key}</h3>
                    <table border="1" cellPadding="5" cellSpacing="0" style={{ width: '100%' }}>
                        <thead>
                            <tr>
                                {Object.keys(data[key][0] || {}).map((header) => (
                                    <th key={header}>{header}</th>
                                ))}
                            </tr>
                        </thead>
                        <tbody>
                            {data[key].map((row, index) => (
                                <tr key={index}>
                                    {Object.values(row).map((value, i) => (
                                        <td key={i}>{value}</td>
                                    ))}
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            ))}
        </div>
    );
}

export default ToOAndTables;
